-- ----------------------------
-- Function structure for `getChildList`
-- ----------------------------
DROP FUNCTION IF EXISTS `getChildList`;
DELIMITER ;;
CREATE DEFINER=`iot`@`%` FUNCTION `getChildList`(rootid varchar(40)) RETURNS varchar(5000) CHARSET utf8
BEGIN 
		DECLARE sTemp varchar(5000); -- TEXT
			DECLARE sTempChd varchar(5000); -- TEXT
     
      SET sTemp = '$'; 
      SET sTempChd =rootid; 
    
      WHILE sTempChd is not null DO 
				SET sTemp = concat(sTemp,',',sTempChd); 
				SELECT group_concat(room_id) INTO sTempChd FROM iot_room_info where valid=1 and FIND_IN_SET(room_pid,sTempChd)>0; 
      END WHILE; 
			RETURN sTemp; 

   END
;;
DELIMITER ;
